import React, { Component } from 'react';

class Nav extends Component {
    state = {
        text:[],
    };

    submitRef = React.createRef();

    onsubmitEvent = (e) => {
        e.preventDefault();
        const newText = [this.onSubmitRef.current.value, ...this.state.text];
        this.setState({text: newText});
    };

    render() {
        return (
            <>
              <nav> youtube</nav>
              <form onSubmit={this.onSubmitEvent}>
              <input ref={this.submitRef} type="text" name="" id=""/>    
              <button className="find-button">find</button>
              </form>   

            <ul>
                {this.state.text.map((item) => {
                    return <li>{item}</li>;
                })}
            </ul>
            </>
        );
    }
}

export default Nav;
